value:
(props: {
  publicPerson: PublicPerson | undefined;
}) => {
  const { publicPerson } = props;

  return !publicPerson ? null : (
    <Div className="w-full bg-red-500">
      <ModelItemAssetView
        item={publicPerson}
        backendAsset={publicPerson?.pictureImage}
        hideDownloadLink
        className=" w-[800px]"
      />
      <P>{publicPerson.name}</P>
    </Div>
  );
}
